var v = ["Bicyclette \xE0 1 vitesse, pneus 1/2 ballon. Cadre de 52cm. Jantes chrom\xE9es. Roue Hore.  Moyeux ind\xE9r\xE9glables. 2 freins sur jantes. Guidon trials. Garde-boue et couvre chaine en acier \xE9maill\xE9. Porte-bagages. Gardejupes. P\xE9dales \xE0 blocs caoutchouc. \xC9mail couleur. Selle route cuir. Sacoche avec outillage. Pompe de cadre. Timbre avertisseur.", "Cadre raccord bras\xE9 de 53 ou 58 %. Jantes en acier \xE9maill\xE9es. Pneus \u201CHiron\u201D 700 x 35, garantis 12 mois. Pignon roue libre \xE0 emboitement hexagonal. Frein \u201CHirondelle\u201D sur jante arri\xE8re. Garde-boue m\xE9tal.", "Carrosserie en t\xF4le d'acier laqu\xE9 blanc mont\xE9e sur roues pour faciliter le d\xE9placement, couvercle laqu\xE9 blanc, dessus et cuve en m\xE9tal \xE9maille marron, inalt\xE9rable a l'eau de lessive et a la chaleur,", "Ce magnifique radio-phono comprend un excellent r\xE9cepteur radioL'ensemble, dans une belle \xE9b\xE9nisterie teint\xE9e palissandre, forme un tr\xE8s phonique 6 lampes et un tourne-disque de vitesses plac\xE9 sous le couvercle. Beau meuble. Ce mod\xE8le, dont le montage particuli\xE8rement soigne assure un tr\xE8s bon rendement aussi bien en radio qu'en phono, est garanti mn an.", "Ces m\xE9dailles et \xE9pingles sont en argent avec patine artistique. Elles ont \xE9t\xE9 compos\xE9es et frapp\xE9es sp\xE9cialement dans les ateliers de l'\xC9tat pour la Soci\xE9t\xE9 l'Hirondelle.", "Lanterne cuivre fort, finement nickel\xE9, chute d'eau r\xE9glable, suspension antivibratrice, projecteur diam\xE8tre cm2, avec verre bomb\xE9. Dur\xE9e d'\xE9clairage 3 heures. Poids 395 grammes.", "Lunettes \xE9tanches, monture caoutchouc moul\xE9 de 1re qual. glaces rondes de 55 mm de diam. en verre clair. Les lunettes prot\xE8gent les yeux contre les poussi\xE8res, fum\xE9es et gaz industriels et se portent av. nos masques 5862-5864. Pds 60 gr.", "Maillot en coton fin \xE0 rayures se boutonnant devant pour enfants.", "Montre-bracelet, dite \u201Cd'Aviateur\u201D, m\xE9tal inalt\xE9rable, diam. 435ym. Mouvement de pr\xE9cision chronographe, cadran avec grande aiguille trotteuse, permettant la lecture 1/25de seconde.", "Moteur Villiers. Puissance au frein : 7 HP, 3 vitesses, lancement au pied, \xE9clairage \xE9lectrique, carrosserie 2 places, coffre \xE0 outils, outillage complet, capote et pare-brise.", "Petite griffe \xE0 sarcler. 5 dents en acier, largeur 8 cm. poign\xE9e estamp\xE9e, longueur 26 cm. poids 150 gr. Pour ameublir le sol, arracher les herbes entre les plantes ou fleurs cultiv\xE9es en lignes rapproch\xE9es.", "Rasoir de s\xFBret\xE9 \u201CPrima\u201D tout en laiton massif nickel\xE9 chrom\xE9, manche molet\xE9 bien en main. Peigne et contre-peigne galb\xE9s tenant tout d'une pi\xE8ce, fermeture \xE0 charni\xE8re, blocage instantan\xE9 de la lame.", "R\xE9cepteurs de t\xE9l\xE9vision \xE0 haute d\xE9finition 819 lignes, donnant une image tr\xE8s nette et d'un contraste agr\xE9able ne fatiguant pas la vue, le montage de la partie radio donne un son absolument remarquable.", "Tous nos appareils sont blind\xE9s pour que leur rayonnement ne trouble pas les r\xE9cepteurs radiophoniques, et ils fonctionnent sur courant alternatif 50 riodes 110 et 220 volts. Ils sont garantis pendant 1 an; toutefois, suivant la r\xE8gle, le tube cathodique est garanti pour 6 mois seulement."];
